import React from "react";
import "./Square.css";

export default function Square({ width, height, rotation, colors }) {
  return (
    <div style={{
        width: width,
        height: height,
        transform: `rotate(${rotation}deg)`,
        position: relative
    }}>
      <div className="empty"></div>
      <div class="filled"></div>
    </div>
  );
}
